DROP TABLE IF EXISTS `tb_flight_flows`;
CREATE TABLE `tb_flight_flows` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '序号',
  `missionBatch` varchar(64) NOT NULL COMMENT '任务批次号',
  `missionID` varchar(30) NOT NULL COMMENT '任务编号',
  `siteID` varchar(30) NOT NULL COMMENT '起始站编号',
  `UAVID` varchar(30) NOT NULL COMMENT '无人机编号',
  `returnMode` tinyint(1) NOT NULL COMMENT '返航方式 1-起始站 2-其他站',
  `endSiteID` varchar(30) NOT NULL COMMENT '终点站编号',
  `flowState` tinyint(1) NOT NULL COMMENT '流程状态',
  `flowStateInfo` varchar(255) DEFAULT NULL COMMENT '流程状态描述',
  `flowSubState` tinyint DEFAULT NULL COMMENT '流程子状态',
  `flowSubStateInfo` varchar(255) DEFAULT NULL COMMENT '流程子状态描述',
  `UAVStartOffTime` varchar(30) DEFAULT NULL COMMENT '无人机起飞时间',
  `UAVLandTime` varchar(30) DEFAULT NULL COMMENT '无人机降落时间',
  `flightParams` longblob COMMENT '航线任务',
  `missionType` tinyint DEFAULT NULL COMMENT '任务类型',
  `missionSource` tinyint DEFAULT NULL COMMENT '任务源 1-祺云下发,2-祺云定时任务,3-三方平台',
  `missionName` varchar(50) DEFAULT NULL COMMENT '任务名称',
  `CPID` varchar(50) DEFAULT NULL,
  `PID` varchar(30) DEFAULT NULL,
  `excuteTime` int DEFAULT NULL COMMENT '定时任务执行时间',
  `missionStartTime` varchar(30) DEFAULT NULL COMMENT '航线任务开始时间',
  `senceId` int DEFAULT NULL COMMENT '场景类型ID',
  `taskId` int DEFAULT NULL COMMENT '巡检作业类型ID',
  `missionEndTime` varchar(30) DEFAULT NULL COMMENT '航线任务结束时间',
  `isExcute` tinyint(1) DEFAULT NULL COMMENT '是否立即执行 1-是 0-否',
  `missionBatchState` tinyint(1) DEFAULT NULL COMMENT '任务批次状态 0-未执行 1-执行中',
  `createTime` varchar(50) NOT NULL COMMENT '创建时间',
  `creatorID` bigint NOT NULL COMMENT '创建人编号',
  `createUser` varchar(16) NOT NULL COMMENT '创建用户',
  `updateTime` varchar(30) DEFAULT NULL COMMENT '更新时间',
  `updatorID` bigint DEFAULT NULL COMMENT '更新人编号',
  `updateUser` varchar(16) DEFAULT NULL COMMENT '更新用户',
  `startHiveID` varchar(30) DEFAULT NULL COMMENT '起点机库编号',
  `endHiveID` varchar(30) DEFAULT NULL COMMENT '终点机库编号',
  `isDelete` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  `UAVFlightMileage` double(10,2) DEFAULT NULL COMMENT '无人机飞行总里程',
  `UAVFlightTime` int DEFAULT NULL COMMENT '无人机飞行总时间',
  `params1` varchar(20) DEFAULT NULL COMMENT '备用参数1',
  `siteName` varchar(50) DEFAULT NULL COMMENT '站点名称',
  `UAVStartOffPower` tinyint DEFAULT NULL COMMENT '无人机起飞时电量',
  `UAVLandPower` tinyint DEFAULT NULL COMMENT '无人机着陆时电量',
  `UAVBatCCount` int DEFAULT NULL COMMENT '无人机电池循环次数',
  `landSpot` varchar(128) NOT NULL DEFAULT '' COMMENT '无人机降落点坐标',
  `CMID` varchar(30) NOT NULL DEFAULT '' COMMENT '计划任务编号',
  `secondFlightCode` longtext,
  `isSecondFlight` bigint DEFAULT NULL,
  `customCameraConf` json DEFAULT NULL COMMENT '自定义相机配置参数',
  `customWindTurbineConf` json DEFAULT NULL COMMENT '自定义风机巡检参数',
  `customFlightMissionConf` json DEFAULT NULL COMMENT '自定义任务飞行配置参数',
  `finishAction` tinyint(1) DEFAULT NULL COMMENT '完成动作 1-自动返航至起始点,2-无人机悬停不返航,3-返航至自定义降落点,4-返回到终点站',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `siteID` (`siteID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

