COMMIT;

-- ----------------------------
-- Table structure for tb_flight_schedules
-- ----------------------------
DROP TABLE IF EXISTS `tb_flight_schedules`;
CREATE TABLE `tb_flight_schedules` (
  `id` int NOT NULL AUTO_INCREMENT,
  `missionBatch` varchar(64) NOT NULL COMMENT '任务批次号',
  `missionID` varchar(40) NOT NULL COMMENT '任务ID',
  `missionName` varchar(50) DEFAULT NULL COMMENT '任务名称',
  `siteID` varchar(30) DEFAULT NULL COMMENT '站点ID',
  `siteName` varchar(50) DEFAULT NULL COMMENT '站点名称',
  `UAVID` varchar(30) NOT NULL COMMENT '无人机编号',
  `startHiveID` varchar(30) DEFAULT NULL COMMENT '起点机库编号',
  `endHiveID` varchar(30) DEFAULT NULL COMMENT '终点机库编号',
  `UAVStartTime` varchar(30) DEFAULT NULL COMMENT '无人机起飞时间',
  `UAVEndTime` varchar(30) DEFAULT NULL COMMENT '无人机降落时间',
  `missionDeliveryTime` varchar(50) DEFAULT NULL COMMENT '任务下发时间',
  `state` tinyint(1) DEFAULT NULL COMMENT '状态  ',
  `finishAction` tinyint(1) DEFAULT NULL COMMENT '完成动作 1-自动返航至起始点,2-无人机悬停不返航,3-返航至自定义降落点,4-返回到终点站',
  `landSpot` varchar(128) NOT NULL DEFAULT '' COMMENT '无人机降落点坐标',
  `remark` text COMMENT '备注',
  `endSiteID` varchar(30) DEFAULT NULL COMMENT '终点站编号',
  `missionEndTime` varchar(30) DEFAULT NULL COMMENT '航线任务结束时间',
  `UAVFlightMileage` double(10,2) DEFAULT '0.00' COMMENT '无人机飞行里程 -米',
  `UAVFlightTime` bigint DEFAULT '0' COMMENT '无人机飞行时间 -秒',
  `isDelete` tinyint unsigned DEFAULT '0' COMMENT '是否删除',
  `params1` varchar(10) DEFAULT NULL COMMENT '用于查询飞行报文辅助字段',
  `isAutoCP` tinyint(1) DEFAULT '0' COMMENT '是否自动完成',
  `missionSource` tinyint(1) DEFAULT '1' COMMENT '任务源 1-祺云库立即下发,2-祺云系统计划任务 3-三方平台 默认1',
  `flightParams` longblob COMMENT '三方平台任务存储',
  `CPID` varchar(50) DEFAULT NULL COMMENT '企业编号',
  `PID` varchar(50) DEFAULT NULL COMMENT '项目编号',
  `CMID` varchar(30) DEFAULT NULL COMMENT '计划任务编号',
  `photoSum` int DEFAULT NULL COMMENT '拍照总数量',
  `videoSum` int DEFAULT NULL COMMENT '视频总数量',
  `createTime` varchar(50) DEFAULT NULL COMMENT '创建时间',
  `creatorID` bigint DEFAULT NULL COMMENT '创建人编号',
  `createUser` varchar(50) DEFAULT NULL COMMENT '创建用户',
  `updateTime` varchar(30) DEFAULT NULL COMMENT '更新时间',
  `updatorID` bigint DEFAULT NULL COMMENT '更新人编号',
  `updateUser` varchar(50) DEFAULT NULL COMMENT '更新用户',
  `UAVStartOffPower` tinyint DEFAULT NULL COMMENT '无人机起飞时电量',
  `UAVLandPower` tinyint DEFAULT NULL COMMENT '无人机着陆时电量',
  `UAVBatCCount` int DEFAULT NULL COMMENT '无人机电池循环次数',
  `isExistResult` tinyint(1) unsigned zerofill NOT NULL DEFAULT '0' COMMENT '是否存在成果  0 不存在  1 存在',
  `senceId` int DEFAULT '0' COMMENT '巡检场景类型ID',
  `taskId` int DEFAULT '0' COMMENT '巡检作业类型ID',
  `missionStartTime` varchar(30) NOT NULL DEFAULT '' COMMENT '航线任务开始时间',
  `UAVReportCount` int DEFAULT NULL COMMENT '无人机报文总数',
  `customCameraConf` json DEFAULT NULL COMMENT '自定义相机配置参数',
  `customWindTurbineConf` json DEFAULT NULL COMMENT '自定义风机巡检参数',
  `customFlightMissionConf` json DEFAULT NULL COMMENT '自定义任务飞行配置参数',
  `content` text COMMENT '备注',
  `UAVRVURL` varchar(255) DEFAULT NULL COMMENT '无人机FPV第一视角',
  `UAVStartTimeMSDK` varchar(32) NOT NULL DEFAULT '' COMMENT '无人机起飞时间(地面站时间)',
  `UAVEndTimeMSDK` varchar(32) NOT NULL DEFAULT '' COMMENT '无人机降落时间(地面站时间)',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `missionBatch_index` (`missionBatch`) USING BTREE,
  KEY `siteID_index` (`siteID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

