-- ----------------------------
-- Table structure for tb_sites
-- ----------------------------
DROP TABLE IF EXISTS `tb_sites`;
CREATE TABLE `tb_sites` (
  `id` int NOT NULL AUTO_INCREMENT,
  `siteID` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '站点编号',
  `siteMode` tinyint(1) NOT NULL COMMENT '站点模式 1-固定机库+射频基站 2-射频基站 3-单兵中枢 4-移动机库 5-无人机遥控器 6-天枢',
  `siteAddress` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '站点地址',
  `siteName` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '站点名称',
  `siteLocLongitude` double(15,10) DEFAULT NULL COMMENT '站点位置 WGS-84,经度',
  `siteLocLatitude` double(15,10) DEFAULT NULL COMMENT '站点位置 WGS-84,纬度',
  `siteOptionLocLongitude` double(15,10) DEFAULT NULL COMMENT '站点备降位置 WGS-84,经度',
  `siteOptionLocLatitude` double(15,10) DEFAULT NULL COMMENT '站点备降位置 WGS-84 纬度',
  `siteSafeLocLongitude` double(15,10) DEFAULT NULL COMMENT '站点安全位置 WGS-84 经度',
  `siteSafeLocLatitude` double(15,10) DEFAULT NULL COMMENT '站点安全位置 WGS-84 纬度',
  `isDelete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除  1删除 0不删除',
  `createTime` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建时间',
  `updateTime` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '更新时间',
  `siteAltitude` float(6,2) DEFAULT NULL COMMENT '站点相对地面高度',
  `siteHAltitude` float(6,2) DEFAULT NULL COMMENT '站点海拔高度',
  `siteEllipsAltitude` float(6,2) DEFAULT NULL COMMENT '站点椭球高度',
  `videoPullDomain` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '站点拉流域名',
  `siteRHAltitude` float(6,2) DEFAULT NULL COMMENT '站点无人机返航高度',
  `siteFLVURI` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '站点第三视角flv地址',
  `siteRHHeading` float(5,2) DEFAULT NULL COMMENT '站点无人机降落朝向',
  `siteRHHoverAltitude` float(6,2) DEFAULT NULL COMMENT '站点无人机返航降落悬停高度',
  `siteOptionAltitude` float(6,2) DEFAULT NULL COMMENT '站点无人机备降点相对地面高度',
  `siteOptionHoverAltitude` float(6,2) DEFAULT NULL COMMENT '站点无人机备降悬停高度',
  `siteOptionHeading` float(5,2) DEFAULT NULL COMMENT '站点备降朝向',
  `siteFlightMode` tinyint(1) NOT NULL COMMENT '站点飞行模式  1-孤岛模式 2-跳棋模式',
  `createUser` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建者',
  `updateUser` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '更新者',
  `CPID` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '企业编号',
  `PID` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '项目编号',
  `videoPushDomain` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '推流域名',
  `flightWay` tinyint(1) DEFAULT NULL COMMENT '支持的飞行方式 1普通飞行 2精细化飞',
  `isSiteType` tinyint(1) DEFAULT NULL COMMENT '站点类型  1站点类型(带机库) 0单机',
  `UAVCPV` tinyint(1) NOT NULL DEFAULT '1' COMMENT ' 无人机控制协议:1-星逻无人机设备孤岛模式上云协议,2-星逻无人机设备网联通用上云协议,3-星逻无人机设备网联模式上云协议'';',
  `HIVECPV` tinyint(1) NOT NULL COMMENT ' 机库控制协议:4-星逻机库设备孤岛模式上云协议,5-星逻机库设备网联通用模式上云协议,6-星逻机库设备网联模式上云协议,7-大疆机库设备上云协议,8-小机场机库设备协议;',
  `mediaUploadType` tinyint(1) unsigned zerofill DEFAULT NULL COMMENT '1 自动上传 2定时上传 3手动上传 0不上传',
  `siteBkgUrl` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '站点背景图url',
  `networkMode` tinyint(1) DEFAULT '2' COMMENT '网络模式  1-互联网  2-局域网',
  `isComputer` tinyint(1) unsigned zerofill DEFAULT '0' COMMENT '类型5除外,其他类型是否配置机载计算机 默认是否 0',
  `creatorID` bigint DEFAULT NULL COMMENT '创建人ID',
  `updatorID` bigint DEFAULT NULL COMMENT '更新人ID',
  `siteOptionHAltitude` float(6,2) DEFAULT NULL COMMENT '备降点海拔高度',
  `siteOptionEllipsAltitude` float(6,2) DEFAULT NULL COMMENT '备降点椭球高度',
  `UAVSTAltitude` float(6,2) DEFAULT NULL COMMENT '无人机起飞高度',
  `siteOptionRHAltitude` float(6,2) DEFAULT NULL COMMENT '无人机备降点返航高度',
  `actionControlMode` tinyint(1) NOT NULL DEFAULT '1' COMMENT '站点动作控制模式 1-生产模式  2-维护模式',
  `siteOptionMode` tinyint(1) DEFAULT NULL COMMENT '备降模式 0-不使用备降点 1-手动录入备降点  2-动态生成备降点',
  `isUseMOPMode` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否使用MOP双联路模式,0-不使用;1-使用;',
  `signalRange` int NOT NULL DEFAULT '6000' COMMENT '射频信号覆盖范围(米),孤岛模式站点使用,用于校验航点距离站点距离',
  `isUseCheckSignalRange` tinyint(1) NOT NULL DEFAULT '2' COMMENT '是否检查覆盖范围,1-使用,2-不使用,默认:2',
  `supportCustomLayerTypes` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '{}' COMMENT '支持的自定义图层类型,1-二维扫图,2-三维建筑模型,3-点云',
  `isMultipleUAV` tinyint(1) DEFAULT '0' COMMENT '是否支持站点与设备1vn绑定 0-1v1;1-1vn',
  `siteMediaCapacity` double(255,0) DEFAULT '0' COMMENT '站点媒体容量(byte)',
  `siteRecordCapacity` double(255,0) DEFAULT '0' COMMENT '飞行历史录屏容量(byte)',
  `viewLiveConfig` json NOT NULL COMMENT '站点视角配置',
  `useOSSTempCert` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否使用临时凭证 0-不使用;1-使用',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `siteID` (`siteID`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

