-- ----------------------------
-- Table structure for tb_sys_role
-- ----------------------------
DROP TABLE IF EXISTS `tb_sys_role`;
CREATE TABLE `tb_sys_role` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '序号',
  `name` varchar(64) NOT NULL COMMENT '角色名称',
  `code` varchar(64) NOT NULL COMMENT '角色code',
  `status` tinyint DEFAULT NULL COMMENT '状态(0无效,1有效)',
  `remark` varchar(255) DEFAULT NULL COMMENT '描述',
  `type` tinyint NOT NULL COMMENT '类型:1:公共角色；2:特殊角色',
  `createTime` varchar(50) NOT NULL COMMENT '创建时间',
  `creatorID` bigint NOT NULL COMMENT '创建人编号',
  `createUser` varchar(16) NOT NULL COMMENT '创建用户',
  `updateTime` varchar(30) DEFAULT NULL COMMENT '更新时间',
  `updatorID` bigint DEFAULT NULL COMMENT '更新人编号',
  `updateUser` varchar(16) DEFAULT NULL COMMENT '更新用户',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=0 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='角色表';

